Mongoose difficulty understanding how to correctly use promises/async await<p>I have a nodejs back end with express handling the routing for my API to my mongo DB using Mongoose. I have changed the code so its easier to understand but essentially I am building a task list.</p>

<p>I have an endpoint for adding tasks to a tasklist, I want to maintain a list of tasks to perform some analysis on later. The problem that I am having is that I want to check whether a task exists already, if that task doesnt exist then I want to create it in my task model and then add it to my taskList. If it does exist then I just want to add it to my task list.</p>

<p>My first thought was to use async on the save operation when creating a task because I wanted to avoid nesting loads of promises because that makes it quite unreadable. But when my nodejs server starts it gives me an error <code>SyntaxError: await is only valid in async function</code> but from the documentation you can use await on save, and my function has the async keyword. so I don't know what I am doing wrong.</p>

<pre><code>exports.tasklists_add_task = async (req, res, next) =&gt; {
    const id = req.params.tasklistId;

    Task.findOne({ externalId: req.body.externalId })
        .exec()
        .then(doc =&gt; {

            let task = doc;

            if (!task) {
                task = new Task({
                    _id: new mongoose.Types.ObjectId(),
                    externalId: req.body.externalId,
                    name: req.body.name
                });

                await task.save();
            }
            tasklist.update({_id: id}, {$push: { tasks: tasks }})
            .select("-__v")
            .exec() 
        })
        .then(result =&gt; {
            ...
        })
        .catch(err =&gt; { ... })
}
</code></pre>

<p>I have 2 schemas a Task Schema</p>

<pre><code>const mongoose = require("mongoose");

const taskSchema = mongoose.Schema({
    _id: mongoose.Schema.Types.ObjectId,
    externalId: { type: String, required: true },
    name: { type: String, required: true }
});

module.exports = mongoose.model("Task", taskSchema);
</code></pre>

<p>and a Task List Schema</p>

<pre><code>const mongoose = require("mongoose");

const taskListSchema = mongoose.Schema({
    _id: mongoose.Schema.Types.ObjectId,
    user: { type: mongoose.Schema.Types.ObjectId, ref: "User", required: true },
    type: { type: String, required: true },
    tasks: [{ type: mongoose.Schema.Types.ObjectId, ref: "Type" }]
});

module.exports = mongoose.model("TaskList", taskListSchema);
</code></pre>

<p>I don't have to use async await here, I could just chain promises, but I couldn't work out how to chain the promises in a logical readable way since I have to create the task if it doesn't exist.</p>

