Why am I unable to change values of a Mongoose object to a different type ‘directly’?<p>I've just spent a good hour figuring out something mind-boggling (at least to me, as a JS noob) and I'd like to understand the underlying logic (or just why it works this way, because I think it's illogical and quite unexpected).</p>

<p>Suppose I'm using Mongoose to retrieve documents from a database, some or all of which include a date property (created with <code>new Date()</code>), a numeric property, and a string property.</p>

<pre><code>[{
  string: 'foo',
  date: '2018-10-13T21:11:39.244Z',
  number: 10
},
...
{
  string: 'bar',
  date: '2018-10-13T21:12:39.244Z',
  number: 20
}]
</code></pre>

<p>I thus obtain an array of objects and now want to take the date property for each object and change the value to a string, so I do something like:</p>

<pre><code>doc.find({}, (err, list) =&gt; {
  list.forEach((item, index) =&gt; {
    list[index].date = 'new value'
  })
})
</code></pre>

<p><strong>But I can't do that!</strong></p>

<p>I <strong>can</strong> do <code>list[index].string = 'new value'</code> as well as <code>list[index].date = new Date()</code> but I <strong>can't</strong> change values that are of a different type, in this example <code>date</code> and <code>number</code>.</p>

<p>However, when I do <code>list[index]._doc.date = 'new value'</code>, which took so long to figure out because I didn't know Mongoose objects weren't just plain old objects and focused on solving problems I didn't have instead, I can modify the value just fine.</p>

<p>It appears that the mongoose object somehow translates <code>obj.key</code> to <code>obj._doc.key</code> only if the type of the value matches but I'd appreciate a more detailed explanation than my uneducated guesses.</p>

