<p>Is there a way around this: where I can use a <code>$lookup</code> and <code>$unwind</code> here, while also NOT excluding that person if they don't happen to have any data for that field? And would that be accomplished here, or in the <code>$project</code> stage I call a couple of stages later (see code below)?</p>

